import React, { useState, useEffect } from 'react';
import Header from '../components/Header';
import '../styles/Dashboard.css';

function Dashboard() {
  const [careRecipient, setCareRecipient] = useState(null);
  const [upcomingVisits, setUpcomingVisits] = useState([]);
  const [recentHealthEvents, setRecentHealthEvents] = useState([]);
  const [medications, setMedications] = useState([]);

  // Mock data - would be replaced with API calls
  useEffect(() => {
    // Fetch care recipient data
    setCareRecipient({
      id: '1',
      name: 'Martha Johnson',
      age: 78,
      photo: 'https://example.com/photo.jpg'
    });

    // Fetch upcoming visits
    setUpcomingVisits([
      { id: '1', caregiverId: '2', caregiverName: 'John Smith', date: '2025-02-27T10:00:00', type: 'Regular Visit' },
      { id: '2', caregiverId: '3', caregiverName: 'Susan Lee', date: '2025-03-01T14:00:00', type: 'Doctor Appointment' }
    ]);

    // Fetch recent health events
    setRecentHealthEvents([
      { id: '1', date: '2025-02-20', type: 'Blood Pressure Check', notes: 'BP: 132/85' },
      { id: '2', date: '2025-02-18', type: 'Doctor Visit', notes: 'Annual checkup, all clear' }
    ]);

    // Fetch medications
    setMedications([
      { id: '1', name: 'Lisinopril', dosage: '10mg', frequency: 'Once daily' },
      { id: '2', name: 'Vitamin D', dosage: '1000 IU', frequency: 'Once daily' },
      { id: '3', name: 'Metformin', dosage: '500mg', frequency: 'Twice daily' }
    ]);
  }, []);

  return (
    <div className="dashboard-container">
      <Header user={{ name: 'Jane Doe' }} onLogout={() => console.log('logout')} />

      <main>
        {careRecipient && (
          <div className="care-recipient-summary">
            <h2>{careRecipient.name}</h2>
            <div className="care-recipient-details">
              <div className="care-recipient-photo">
                <img src={careRecipient.photo} alt={careRecipient.name} />
              </div>
              <div className="care-recipient-info">
                <p>Age: {careRecipient.age}</p>
                <p>Quick stats go here</p>
              </div>
            </div>
          </div>
        )}

        <div className="dashboard-widgets">
          <section className="widget">
            <h3>Upcoming Visits</h3>
            <ul className="visit-list">
              {upcomingVisits.map(visit => (
                <li key={visit.id} className="visit-item">
                  <div className="visit-date">{new Date(visit.date).toLocaleDateString()}</div>
                  <div className="visit-time">{new Date(visit.date).toLocaleTimeString([], {hour: '2-digit', minute:'2-digit'})}</div>
                  <div className="visit-caregiver">{visit.caregiverName}</div>
                  <div className="visit-type">{visit.type}</div>
                </li>
              ))}
            </ul>
            <a href="/schedule" className="see-all">See all visits</a>
          </section>

          <section className="widget">
            <h3>Recent Health Events</h3>
            <ul className="event-list">
              {recentHealthEvents.map(event => (
                <li key={event.id} className="event-item">
                  <div className="event-date">{new Date(event.date).toLocaleDateString()}</div>
                  <div className="event-type">{event.type}</div>
                  <div className="event-notes">{event.notes}</div>
                </li>
              ))}
            </ul>
            <a href="/health" className="see-all">See all health events</a>
          </section>

          <section className="widget">
            <h3>Medications</h3>
            <ul className="medication-list">
              {medications.map(med => (
                <li key={med.id} className="medication-item">
                  <div className="medication-name">{med.name}</div>
                  <div className="medication-dosage">{med.dosage}</div>
                  <div className="medication-frequency">{med.frequency}</div>
                </li>
              ))}
            </ul>
            <a href="/medications" className="see-all">See all medications</a>
          </section>
        </div>
      </main>
    </div>
  );
}

export default Dashboard;
